import React from 'react'
import { useState } from 'react'
import './Getsupport.css'
export default function Getsupport() {

    const [state,setstate]=useState('Madhya Pradesh');
    const handleStateChange = (e) => {
        setstate(e.target.value);
    };
    const data = {
        "Madhya Pradesh": ["Indore", "Bhopal", "Dewas", "Rewa", "Betul", "Ratlam", "Gwalior", "Ujjain"],
        "Manipur": ["Imphal", "Thoubal", "Kakching", "Bishnupur", "Churachandpur"],
        "Goa": ["Panaji", "Margao", "Vasco da Gama", "Mapusa", "Ponda"],
        "Assam": ["Guwahati", "Silchar", "Dibrugarh", "Jorhat", "Nagaon"],
        "Sikkim": ["Gangtok", "Namchi", "Mangan", "Gyalshing", "Rangpo"]
}
    return (
        <div>
            <div className='top'>
            <h1 className='logos1'>Our Centers</h1>
            <div className='selectContainer'>
                <select className='dropdown' onChange={handleStateChange}>
                        <option value="Madhya Pradesh">Madhya Pradesh</option>
                        <option value="Manipur">Manipur</option>
                        <option value="Goa">Goa</option>
                        <option value="Assam">Assam</option>
                        <option value="Sikkim">Sikkim</option>
                </select>
            </div>
            </div>
            <div className='cardpositioner'>
                {data.map((item,index)=>(
                    <div  key={index} className='cards'>
                    <div className='cardname'><h4>{item.id}</h4></div>
            </div>
                ))}
                
               
            </div>
        </div>
    )
}
